import React from 'react';

function WorksItems({ item }) {
  return (
    <div className="works_card" key={item.id} data-Aos='flip-up' >
      <img src={item.image} alt="" className='work_img' />
      <h3 className="work_title">{item.category}</h3>
      {/* <a href="#" className="work_button">
        Demo <i className="bx bx-right-arrow-alt work_button-icon"></i>
      </a> */}
      <a class="btn btn-success " href="https://github.com">GitHub</a><a className='btn btn-danger' href="">Go to Demo</a>
    </div>
  );
}

export default WorksItems;
